import React from "react";
import { Box, Container, Grid, Typography } from "@mui/material";

const Header = () => {
  return (
    <Container>
    <nav className="ui container center">
      <div className="ui fixed menu">
        <div className="ui container center">
          Hotel
        </div>
      </div>
    </nav>
    </Container>
  );
};

export default Header;
